                <h2>Select a date and genre in the form below</h2>
                <form>
                    <label for="date">Date:</label>
                    <input type="text" id="date" name="date"/>
                    <label for="lname">Genre:</label>
                    <input type="text" id="genre" name="genre"/>
                </form>
            </div>
        )
    }
}
